		"coverLetter": "Hello!\n\nThank you for contacting me! Could you please describe what information on driver and vehicle you need to record? License plate number? Vehicle type? Any other type of information?\n\nI need to know this to better estimate time and cost.\n\nBest Regards,\nDenis Tarasov, PhD\n\nPS\nMore about me:\nI\u0027m working in the field of machine learning and deep learning, and have a number of academic publications, such as:\n\nTarasov D. S., Lukina N. M.,Izotova E. D.Neural Network Based end-to-end learning Hierarchy-aware semantic Parser for Russian language//Computational Linguistics and Intellectual Technologies:Proceedings of the International Conference \u201cDialogue 2017\u201d http://www.dialog-21.ru/media/3955/tarasovdsetal.pdf\n\n2.D.S. TARASOV, E.D. IZOTOVA. COMMON SENSE KNOWLEDGE IN LARGE SCALE NEURAL CONVERSATIONAL MODELS//in Advances in Neural Computation, Machine Learning, and Cognitive Research. Studies in Computational Intelligence, vol 736. Springer, Chamhttps://link.springer.com/chapter/10.1007/978-3-319-66604-4_6\n\nTarasov D.S. (2016) Preserving personal conversational style and diversity in neural conversational models//Proceedings of International Conference on Artificial Neural Networks - Neuroinformatics (2016) V.2. This paper presents a method to apply specific personal conversation traits to neural dialog models, trained on large heterogeneous dialog corpus (paper in Russian, for English abstract see confAbstract is avaliable from conference program url - http://neuroinfo.ru/index.php/en/schedule/sections?year=2016#Stend5).\n\nTarasov D.S, Izotova E.D. (2016) Deep recurrent neural networks for extracting pharmacological terms from Russian texts\u0022 Neuroinformatics (2016) V.2. This paper, produced with collaboration with Institute of Medicine and Biology of Kazan Federal University considers extraction of information from online medical forums for monitoring drug side effects (paper in Russian, for English abstract see conf. program http://neuroinfo.ru/index.php/en/schedule/\n/sections?year=2016 paper text available by request)\n\nTarasov D.S. (2015) Natural Language Generation, Paraphrasing and Summarization of User Reviews with Recurrent Neural Networks // Computational Linguistics and Intellectual Technologies: Proceedings of Annual International Conference \u201cDialogue\u201d, Issue 14(21), V.1, pp. 571-579 (PDF link: http://www.dialog-21.ru/digests/dialog2015/materials/pdf/TarasovDS2.pdf , presentation slides: http://www.meanotek.io/files/natgen.pdf). This paper, reports first successful application of deep learning to generate abstractive multi-document summaries.\n\nTarasov D.S. (2015) Deep Recurrent Neural Networks for Multiple Language Aspect-Based Sentiment Analysis // Computational Linguistics and Intellectual Technologies: Proceedings of Annual International Conference \u201cDialogue\u201d, Issue 14(21), V.2, pp. 65-74 (PDF link: http://www.meanotek.io/files/TarasovDS2015-Dialogue.pdf) - this paper describes aspect-based sentiment analysis system that achieved top results on SentiRuEval-2015 competition (http://www.dialog-21.ru/en/evaluation/2015/tonality/)\n\nI\u0027m the author of NeuThink - an open-source neural network library for natural language processing (https://github.com/Durham/NeuThink)\n\nAlso, you can check my profiles on Stack Overflow (http://stackoverflow.com/users/4367179/denis-tarasov) and Cross Validated (http://stats.stackexchange.com/users/64583/denis-tarasov) where my answers to difficult machine-learning and NLP related questions are ranked high by community",
