		"coverLetter": "Hello,\n\nI\u0027m computer vision algorithm developer.\n\nI will try to introduce myself here in short, but you can find more detail information about my skills and see freelance projects and feedbacks in my Upworks profile:\nhttps://www.upwork.com/freelancers/~011bbd286a75d0edf7?viewMode=1\n\nI\u0027m computer vision algorithm developer, has successful projects on C/C++ and Python.\nI have graduated in strong technical university - Moscow Institute of Physics and Technology.\nI have 7.5 years successful experience in Computer Vision - 2 years working experience in Samsung R\u0026D Ukraine Institute, 1.5 year in freelance in different project, mainly in ADAS, and 2 years I have project with onboard video processing. Last 2 years I working mainly in Deep Learning 1 year - deep learning for images classification. 1 year - my own project - online service with deep learning - for image processing.\n\nDuring the work I working with tasks:\n- deep learning in computer vision: Yolo, GAN, Caffe, PyTorch.\n- object tracking (LK Tracker, TLD tracker, LK Tracker + HOG + SVM tracker)\n- ADAS (moving vehicles detection, road surface marking detection, image stitching)\n- 3D hand reconstruction from 2d Camera\n- segmentation, background subtraction and skin detection\n- feature description (SIFT, SURF, LBP, HAAR, HOG), feature detection (Harris), classifiers (SVM)\n- AC, ASM, AAM,\n- optimization task solving\n- re\u0430l-time \u0430ppl\u0456c\u0430tions\n- tools (evaluation task tools, image labeling tool for training engine of computer vision detector, tool for image manual segmentation, tool for image semi automatic segmentation, segmentation approaches comparison tool, tools for images DB processing)\n\nLooking forward to cooperating.\nBest regards,\nYevgen Gunya",
