		"coverLetter": "Hi there,\n\nThe description does look intriguing and I most definitely can assist you with this task. Let me elaborate.\n\nI\u0027m a Ph.D. in Aircraft Design Manufacturing and Testing and I work with a Data Science team based in Ukraine. It consists of people with similar skills and expert fields, still among the strongest aspects is that we\u0027re combining hands-on programming experience with a knowledge in mathematics and computer science which allows us to successfully apply them in software development. We are engaged in solving problems in such fields as machine learning, applied mathematics, statistics, predictive analytics, data mining, and scraping computer vision.\n\nI have experience developing object detectors. You can see an example of one of the project on this demo server https://cars-detector.requestumdemo.com/use/6a3eb52be4e4c0e2f1d55b373bc2ee859f2c51f7\n\nThe project was related to the detection of cars on satellite maps and the calculation of the density of their distribution over the area.\n\nAnother successful case is the training of a custom object detection model that specializes in detecting soccer players. The trained model showed significantly better results compared to the pre-trained model for YOLOv3 object detector. You can see an example in this video https://drive.google.com/open?id=1bS3FdyLCM2jURLV9GXooxukhEjXIAjxA\n\nThus, I have the necessary skills and experience to successfully implement your project.\n\nI\u2019m really keen to learn more about the project and share my thoughts on ways to resolve the task so please answer me and let\u2019s start our communication.\n\nKind regards,\nVadym S.",
