				"description": "I am a graphic and UX designer with over 15 years experience (10 of them I have been creating interfaces for iOS and Android apps).\n\nYou are welcome to discuss an idea of your web or mobile app with me and I will be happy to apply my experience to your project. I am highly skilled in UX design and I\u2019m able to analyze requirements in order to come app with intuitive journeys for different user flows. \n\nBesides, I follow design trends and always strive to learn modern approaches to creating the best possible experience for end users. Design is my aspiration and I invest time to explain my customers the reasons standing behind all decisions whether it\u2019s the choice of color palette or placing of the element.\n\nMy skill-set includes:\n- Rapid prototyping (wireframes) in Sketch, Balsamiq\n- High fidelity layouts design Adobe Photoshop, Illustrator\n- Clickable prototypes in InVision or Ninjamock\n- Asset preparation for the development (Style guides, placing all materials and configuration of Zeplin)\n\nI have experience designing:\n- Logos, landing pages and business card websites \n- CRM and ERP solutions \n- SaaS platforms with comprehensive dashboards\n- Marketplaces \n- Native and cross-platform mobile apps of any complexity\n\nWrite me a message and let\u2019s create something amazing together!",
