			"ciphertext": "~013b44311714a0a0da",
			"description": "\u0022Programming\u0022 ... Defines my life. I have been into programming since teenage. Always ready to explore new technologies. Willing to engage in some serious work. I have been working in Machine Learning, Deep  Learning and Data Science from past six years. \nBesides that I also have vast experience in network programming, cuda Programming , Android App Development and Web Development.\nClients ranging from startups to Fortune 500 companies across e-commerce, finance, IOT, audio, medicine, healthcare, real-estate and time series domains. \n\nMy past projects technical domains:\n\niOS and Android DEVELOPMENT: \u2713Swift , Objective-C, Java, Kotlin programming languages\nWeb: J2EE, Angular.js, Reactjs, NodeJs\nDatabases: Firebase, MYSQL, CoreData, SQLite, CloudKit,JSON, XML, MongoDb, DynamoDB\n\nLinear regression, Logistic regression, PCA,  Backpropagation, Autoencoders, Generative adversarial network, Reinforcement learning, Dropout regularization, K-means, KNN, SVM, Gaussian mixture model, EKF, UKF, Particle filter, SLAM, Stereo matching, Point cloud, Structure from motion, Path planning, Object detection, Classification, Localization, Segmentation, YOLO, OPENCV\n\n* Natural Language Processing (NLP) \n-- intent, question answering, e-commerce search, conversations. DialogFlow, wit.ai\n-- Abstraction, Extraction Text Summerization, Query Based summerization.\n\n* Time series analysis, prediction -- medical signals, stock/currency markets.\n* Deep reinforcement learning -- decision-making/scheduling problems.\n* Cloud (AWS, Azure, GCE) based network training and deployment.\n\nHands-on expertise with a range of deep learning tools:\n* Tensorflow, Keras, TensorRT, PyTorch, TensorFlow Serving, Caffe, Deeplearning4j, Kubernetes, Tensorflow lite and Theano expert using CUDA backend. \n* Distributed network training (across CPUs/GPUs). \n* Building GPU-Accelerated Workflows with TensorFlow and Kubernetes\n* Data processing: pandas, dask, h5py, Spark.\n\n* Speech, Audio analysis \n-- speech to text, noise removal, source separation. DeepSpeech, DeepVoice, Alexa.\n--text to speech pocket phoenix,Kaldi toolkit\n\n* CHAT BOTS\n-- my-croft open source AI chat bot \n \n* Computer Vision, Object detection, Segmentation\n-- locating, segmenting, bounding objects in medical/natural images. SSD, Yolo, RCNN.\n\nProficient in building/training cutting-edge, novel neural architectures across various verticals. Familiar with latest research involving DNN, CNN, RNN / LSTM, seq2seq,GAN, attention models.\nNatural Language Processing with Transformers:\n\nHugging Face Transformers\n\nRoBERTa, XLNet, BERT, GPT-2, Transformer-XL, BERT with TensorRT, Custom models\n\nBiomedical NLP:\nBioBERT, SciSpacy, BioELMO, NegBio\n\nQuestion-Answering:\nSQUAD, HotpotQA, MovieQA, Biomedical question answering\n\nEmbeddings:\nUniversal Sentence Encoder,ELMO, BERT, Flair,Glove,FastText\n\nCloud services:\nGoogle Cloud, AWS,IBM Cloud, Digital Ocean, Heroku, Paper space and others\n\nIf you are searching someone who is passionate for programming and research. you are on the right page.",
