		"coverLetter": "Hi! Thank you for posting this job.\n\nI have read your job description. As per your job requirements, you need computer Vision expert to create a system in which you can take pictures of driver and the vehicle when they arrive and depart from our garage. \n\nFOR THIS PROJECT :  Firstly, I will be applying an object detection algorithm to detect cars and by taking the license plate location, I will extract numbers and store it on database. For driver detection I will be applying the face recognition technique and assign an id to them and track accordingly and capture the actions taken by the driver and check on which car he or she has sat.\n\nI have done a similar project as Driver Drowsiness Detection System: This project is accomplished for the U.A.E based client. we have to build a custom face detection and landmarks recognition model with the backed on Resnet 53 and Keras.Tensorflow as a framework. It is a computer vision system that can automatically detect driver drowsiness at a real-time video stream and then play the alarm if the driver appears to be drowsy. It is determined by how long a given person\u2019s eyes have been closed for, If eyes have been closed for a certain amount of time, we\u2019ll assume that he is starting to doze off and play the alarm to wake him up and grab driver\u2019s attention.\n\nWe can discuss the details over chat, feel free to message me and ask any question. Let me talk about my EXPERIENCE now.\n\nWell, regarding this project, I have extensive 2+ years of experience in DEEP LEARNING, MACHINE LEARNING \u0026 ARTIFICIAL INTELLIGENCE projects using Python. I have worked in an efficient and correct way. As you can see in my profile, I have been worked for different projects and got a response from employers by getting awesome feedback. I will surely complete work within the required time.I have worked across various domains such as building data pipelines, Banking, Insurance, Healthcare, Telecom, Business Development.\n\nI have been working for the following field related projects:\n\nClassification, Regression, Clustering, Dimensionality Reduction, Prediction, Recognition, Time Series Forecasting, Recommender Systems, Sentiment Analysis, NLP(Natural Language Processing), Big Data Visualisation, Data Mining, Data Analysis, Data warehousing, Data Modelling\nSo on . . .\n\nSome of the projects on which I worked are: (some are attached with proposal)\n\n- Movie Recommendation website using Machine Learning + Web Development Knowledge\n- Image Segmentation\n-Emotion Recognition\n- Machine Learning Bot that plays Tic Tac Toe at 10x10 board size. The tree size of 10x10 board is more than the number of atoms in the universe.\n-Brain MRI Images classification\n-Driver Drowsiness Detection System\n- Age, Gender prediction by looking at the face of a person\n- Hair Segmentation\n- Fashion Style Classification\n-AI model for Building Inspector\n- Object Detection\n- Automatic License Plate Recognition\n- Security System for boats and ships\n- Facial Recognition\n- Potential Customer prediction\n- Predict if a comment is toxic or not\n- Predict how likely a windows machine is to be hit by malware.\n\nTools I use:- - Python - R - Matlab - Numpy/ pandas/matplotlib - scikit learn - tensorflow - keras - yolo api \u2013 pytorch, Augmented reality, virtual reality\n\nPlease contact me, I hope you share the details related with this job.\n\nI will look forward your positive reply\nThanks\nDeepanshu",
