			"ciphertext": "~01f58308279b9090d4",
			"description": "I\u0027m a Software Engineer plus Web and Mobile Applications Developer. I will help you transform your personal or business concept into a successful project. I have a professional work ethics and will treat your business with the same level of respect as my business. I have extensive experience in building high quality Websites, web applications, react native apps, progressive web apps , CRM (Kajabi , Infusionsoft), Zapier, shopify apps, wordpress plugins, SMS and Email marketing solutions and data scraping with Python.\n\nMy other expertise are third party integration into your application via API. I have worked with several REST and SDK based APIs. Below is the list of some APIs I have worked with.\n1. VOIP APIs (Twilio , Tropo , Plivo , Nexmo ,  Bandwidth , Brust, Tel , Zang) and many others.\n\n2. Email Autoresponders APIs (Aweber , MailChimp , Active Campaign , GetResponse , Mailer Lite , Sandlane , SendReach , Icontact) and many others.\n\n3. Payment Gateways APIs ( Pay_Pal, JVZoo , ClickBank , Stripe, 2checkout,) and many others.\n\n4. Social Media APIs ( Facebook , Twitter , Intagram , Google API ) and many others.\n\n5. Printing APIs ( Scaleable Press , TShirt Gang).\n\n6. SMTP Based APIs ( SparkPost , Send Grid , Mandril , Mad Mimi  ) and many others.\n \n7. Cpanel and WHM API.\n\nMy Expertise\n===========\n\nWith more than 6 years of experience in web based applications and android apps.\n\nI have firm command over \n\n- Web-based solutions and applications\n- Progressive Web Applications\n- Android Native Apps\n- React Native Apps\n- Data Scraping \n- CRM Integration\n- Interactive Interfaces\n- API\u0027s Development\n- Shopify Apps\n- Wordpress Plugins\n- Woo Commerce\n- Web Applications Programming\n- Data Base Development\n- Online Forms\n- Static And Dynamic Business Websites.\n- Digital And Online Marketing\n- SMS and Email Marketing Solutions\n\nIt\u0027s important to me to build long term relationships with clients, so I\u0027m primarily looking for long term projects.\nI\u0027m flexible with my working hours and am happy to work closely with any existing freelancers you work with.\n\nI will work with you to discover what you need and create the best solution.My priorities are quality and respect of deadlines and budget.I love to share my enthusiasm and passion for development, so feel free to contact me and lets\u0027s get the conversation started.",
