			"description": "I have 4 years of experience in developing Web and Mobile apps using latest state of the art technologies with 100% success rate. Extensive documented track record of building apps using the MERN Stack, React Stack, Hybrid and Native Android/iPhone apps\n\nI have worked with multiple startups like Panacloud, Axiom, Pak ever zone, Indus Tritech, PIAIC and Cykube.\n\nMy core competency lies in developing apps using MERN and React native. I\u2019m full stack developer and can contribute on both frontend and backend using wide range of technologies. On frontend I have expertise in React  with RxJS, Redux, webpack, Material UI, Bootstrap 4 and React Native. On backend I have expertise on both n-tier and serverless using Node.js  with multiple options in database like SQL, NoSQL and Firebase.\n\nA bit more about myself, I have extensive educational background in software engineering. I hold a bachelor\u2019s degree in software engineering from Indus University, I am also a corda certified blockchain developer from R3.\n\nI have command over:\n\nJavascript, Kotlin\nMERN Stack: NodeJS, React, Mongodb, Express, Mongoose\nDevOps: Docker, Kubernetes and AWS\nReact Stack: ReactJS, Redux, React-Router, formsy, redux-thunk, Material UI\nHybrid application,  React Native\nMySQL, Mongodb\n\n\nAlso worked on:\nFacebook API, Twitter API, Twilio API and multiple others\nPassportJS\nGoogle Maps\nPhoneGap build from phonegap site\nCommand over converting PSD to pixel perfect HTML\n\nMy Projects include:\n1) Working on Responsive piaic with React JS, Bootstrap, Node.js and MongoDB.\n\n2) Recently working on multiple web application using React JS, Bootstrap, Node.js and MongoDB\n\n3) Completed development of NBA for basket ball match\n\n\n4) Completed react native app for surveys\n\n5) Completed web application for job searching on react, node, mongo db\n\n5) Completed development of Online mobile selling application for mobile phone Marketing using react js, Backbone, Node.js and MongoDB\n ",
