			"description": "Hi! \ud83d\udc4b\nI have 5 years of experience in Web and Mobile development. \nI\u0027ve been involved in developing a wide range of mobile and web applications for healthcare, retail, construction, social network, fitness, e-commerce, food delivery, education industries with geo-location, live-chat, work-force management, accounting, invoicing and other modules. \n\nThrough the whole development process, I follow the goal to satisfy your needs and deliver the most suitable solutions for you. \ud83e\udd1d\n\n\ud83d\udc8e My main specialties\ud83d\udc8e \n\u2705 Mobile:\n- Android: Java, Kotlin\n- iOS: Swift, Objective-C \n\n\u2705 Web:\n- Front-end development: Angular, React, JavaScript, HTML/CSS, Material Design, UX/UI Design\n- Back-end development: Google Firebase, PHP/Laravel, Java, MySQL, APIs: Facebook, Google Maps.\n\nOther Experience:\n- Google Map Integration\n- Payments integration\n- Chat \u0026 Messaging \n- Facebook API\n- REST API\n- Twilio\n\n\ud83d\udc8eMy advantages\ud83d\udc8e\n\u2714 Pre-launch support: \n\u2022 Graphic design;\n\u2022 Backend API development;\n\u2022 Frontend development;\n\u2022 Admin Panel or CMS;\n\u2022 Testing and Quality Assurance;\n\u2022 App Store Submission and Approval.\n\n\u2714 Post-launch support:\n\u2022 Maintenance/Bug Fixing;\n\u2022 Further Extensions.",
