			"ciphertext": "~01c506d3b929e4600a",
			"description": "I am a reliable, creative professional mobile development expert specializing in native iOS/Android apps and backend service/SaaS platform integration.\n\nIn the past several years I have built many iOS and Android applications, with a focus on Maps, GPS, PUSH, and geospatial data as well as experience in information management and presentation. My core ability is complete engineering of mobile applications from the ground up, choosing an appropriate database, logic, and UI technologies from the array of existing options. \n\nI have used backend integration with REST service as well direct DB calls, used BaaS platforms like Firebase/QuickBlox, Geolocation, Geo-fencing, Payment integration, facebook/twitter/Instagram/foursquare integration, and a lot of other technologies in the iOS apps.\n\nMy experience:  \u00b7 \nObjective-C, 10 years \u00b7\nSwift, 4+ years \u00b7 \niOS SDK, 5 years \u00b7 \nCore Data, 3 years \u00b7 \nApple Xcode, 3 years \u00b7 \nREST, 5 years \u00b7 \nCocoa Touch, 3 years \u00b7 \nGitHub, 4 years \u00b7 \nJIRA, 2 years \u00b7\nFirebase/QuickBlox/Parse SDK, 2 years\nParse, 4 Years\nFirebase 5 Years\nI own an iPhone 5, 7, iPad Air and iWatch 3.0 to test on. My workstation is a Mac Pro with Xcode 11, Adobe Photoshop CC, and Microsoft Office installed. \n\nI am highly available based on your timezone to discuss ongoing and future projects.  Please feel free to contact me.",
