			"description": "Hello,\n\nI\u0027m Anshul, I\u0027m a Senior Solutions Architect and a Full Stack Developer with experience in technologies like Angular, Node, Java, React, React Native etc. \n\nI have been working for last 5 years, started as an intern in a startup that ended up being one of the biggest content companies in the world. This gave me an opportunity to work on technologies like AWS, Lua, Redis, MongoDB, etc.\n\nI worked remotely with two stealth startups, very promising but at the same time very challenging and complex. They were in AdTech+IoT and Identity+Privacy+Security domains. \n\nHere are the list of technologies that I generally work with:\n\nFrontend Development\n- React JS\n- Angular and AngularJS\n- Javascript/jQuery\n\nBackend\n- NodeJs - ExpressJs, Sequelize, Mongoose, etc.\n- Java - Spring, Dropwizard, Hibernate, JUnit, Mockito, etc.\n- PHP - CodeIgniter, Laravel\n\nDevOps \n- AWS - EC2, S3, RDS, RedShift, ELB, ElastiCache, SES, SQS, etc.\n- Nginx, Apache, UWSGI, Openresty\n- HAProxy\n- CI/CD\n- SocketIO / Websockets\n- Python - Flask, Django\n\nMobile\n- React Native\n\nCMS\n- Wordpress\n- Shopify\n- Ghost\n\nDesign\n- HTML, CSS, Bootstrap, Material\n- Photoshop, Illustrator, XD, Figma\n- UI/UX\n\nCRM\n- SalesForce - Force.com\n\n\n",
