			"description": "I have over a decade of experience in developing Web and Mobile apps using latest state of the art technologies with 100% success rate. Extensive documented track record of building apps using the MEAN Stack, React Stack, Flutter, and Larval. \n\nI have worked with multiple startups like Zabihah, Knotable, Magalix, Kinto, smeen.travel, FinanceBakerZ, TradeBakerZ on Upwork, Elance and Freelancer.\n\nMy core competency lies in developing apps using MEAN and React Stack. I\u2019m full stack developer and can contribute on both frontend and backend using wide range of technologies. On frontend I have expertise in React and Angular2 with RxJS, Redux, webpack, Material UI, Bootstrap 4, D3, Angularfire2, Ionic2, React Native and Flutter. On backend I have expertise on both n-tier and serverless using Node.js, Meteor, Larval, AWS, AWS lambda functions with multiple options in database like SQL, NoSQL and Firebase.\n\nA bit more about myself, I have extensive educational background in computer science. I hold a bachelor\u2019s degree in computer science with 5 software development certifications from CodeSchool, Udemy, MongoDB Universty .\nI have command over:\n\nJavascript, Typescript, PHP, Dart\nMEAN Stack: NodeJS, AngularJS, MongoDB, Express, Mongoose, Meteor, Larval, WordPress\nReact Stack: ReactJS, Redux, React-Router, redux-thunk, Material UI\nHybrid application, Ionic, React Native, Flutter (Android and IOS)\nMySQL, MongoDB, GraphQL\n\nAlso worked on:\nFacebook API, Twitter API, Twilio API and multiple others\nPassportJS\nGoogle Maps\nCommand over converting PSD to pixel perfect HTML",
