			"ciphertext": "~01ef01fd6ae2bcb998",
			"description": "JAVA -- KOTLIN -- Objective-C -- SWIFT - Flutter - React Native\n\nHi, My name is KK Patel and I\u0027m here to turn your ideas into reality. \n\nI believe my strong points are my Responsibility and Punctuality. When working on a new project, I like to listen to the client, so that I can have a clear understanding of his/her needs and vision of the project and maybe suggest some interesting ideas. \n\n- iPhone, iPod, iPad, Android, Tablet\n- Web Service, APIs, Ajax, XML, JSON, RSS, SOAP, WSDL\n- Unity3d, objective-c, JAVA, KOTLIN\n- In-App purchase and Push Notification\n- Social Media - Facebook, Twitter, Google+\n- Barcode, QR scanner\n- Google Map Service, Geo Location, GPS\n- Calendar, Alarm, Reminder\n- MySQL, SQLite, HTML5, PHP, JSON\n- iCloud, CoreData, Storyboard, Newsstand, CoreAnimation, AutoLaout\n- Flurry, Testflight\n- UI/UX Design and Development\n\nAre you looking for a Sr. Android App Developer or Sr. iOS App Developer for your Native Mobile Apps? Are you looking for a person who takes the responsibility of Mobile app development and delivers a quality product without any bug? I can help you to Make your product (Mobile App) run successfully in the market. \n\nI have a strong grip over developing these below-listed domain\u0027s app:\n-----------------------------------------------------------------------------------------\n1) Traveling App (iOS and Android)\n2) Food and Beverages App (iOS and Android)\n3) Social Media App (iOS and Android)\n4) On-demand service application (iOS and Android)\n5) Real Estate App (iOS and Android)\n6) Taxi Application (iOS and Android)\n\nWhat differentiates me from other candidates is my understanding of the entire process and my ability to handle all aspects of mobile application development. \n\nIf my experience and/or skills meet your project needs, please feel free to contact me.\n\nI believe in building a Scalable product which loved the users. \n\nBest Regards, \nKK",
