			"ciphertext": "~0101f56abadb3f8ce7",
			"description": "UX/UI designer by day, Front-End developer by night. Leaving footprints on the web, one pixel at a time.\n\nI am an expert in Web and Mobile Designer with over 5,000 hours spent directly working on digital products. I believe the relevance of a user-centric design depends on how intricate, scrupulous \u0026 unambiguous is the user research propelling the design. My goal is not only the acquisition of design knowledge \u0026 user insights but also synthesis \u0026 interpretation of the same to find clear design drivers for concept development.\nMy design decisions are rooted in a thorough understanding of the goals of the business and customer.\n\n\ud83c\udfa8 UX/UI:\nDesign software and platforms that meet people\u2019s needs. I combine interfaces and workflows to enhance good user experience.\n\n\u25cf Understand and translate business requirements, and user tasks and expectations into\ncompelling user experiences.\n\u25cf Create interfaces that take into consideration content, navigational structure, human-machine\ninteraction, and non-functional constraints.\n\u25cf Prepare wireframes and/or storyboards. Review with key stakeholders, make adjustments\nbased on feedback and obtain final approval\n\u25cf Being service-oriented and able to present, explain and justify designs to stakeholders\n\u25cf Consistently advocate for the user\u2019s interests, yet balancing professional perfectionism with\nreal-world project constraints\n\u25cf Collaborate with the customer, project manager and development teams during design phases\nand subsequent development support cycles\n\u25cf Ensuring concepts and designs are consistent with the overall branding strategy and marketing initiatives\n\u25cf Execute a wide range of usability tools, such as heuristic review, metrics, usability testing, etc. either as part of design projects or as standalone activities\n\u25cf Provide guidance/review feedback on how to improve the usability of existing software\n\u25cf Cognitive psychology aspects of user interfaces, usability heuristics, emerging user interface trends and industry best practices.\n\n- Proficient in Adobe Creative Suite, Sketch\n- Prototyping techniques (Invisionapp, FramerX)\n- UX Research methodologies \u0026 Artifacts\n\n\ud83d\udda5\ufe0f Front-end:\nReact(CSR/SSR(Next.js)), React Native, HTML/HTML5, CSS/CSS3, SCSS/SASS, JavaScript/TypeScript/ECMAScript, Flexbox, SCSS, Sass, Bootstrap, Bulma, tailwind and Material-UI.\n\nFrameworks:\nReact(CSR/SSR(Next.js)), React Native,\n\nLibraries:\nReact.js, JQuery.js\n\nDatabases:\nFirebase Realtime Database.\n\nTask Runners:\nwebpack\n\nWeb services:\nAmazon Web Services, Heroku, netlify with CICD(GitHub)\n\nVersion Control System:\nGitHub, GitLab\n\nSoftware Management tools\nTrello, Sl@ck, Asana, JIRA, and Basecamp\n\nDevelopment Deliverables:\nWebsite Optimization, Responsive Design, Web Application, eCommerce, Website Development, Website Redesign",
