		"coverLetter": "Hi, I am a full-stack developer with 10 years of experience.\nMy primary skill set includes React + Redux on the client and Node.js on the backend.\nI have worked with SQL and NoSQL databases, including MongoDB, and also with cloud solutions such as Firebase.\n\nWith Node.js I did a lot of projects. Some of them:\n- UNC - Social network to support university educational process similar to LinkedIn and Coursera. Members can message, create groups, share content (photo, video, materials). Teachers can build courses and share them with students. Courses include tests and tasks that may be sent to the teaching stuff for review.\n- SG.HRM \u2013 CRM system for recruiting and training company. The system considers all stages of screening and testing of candidates. Candidate\u0027s card includes more than 45 unique forms. Also, the system can notify via e-mail and Telegram - https://beejee.org/sg_hrm.\n- RentalClub - cross-platform application for suppliers of construction and special equipment for rent - https://beejee.org/rentalclub.\n\nIn fact, I have implemented over 100 projects during my career. You can check more examples on https://beejee.org\nBest regards, \nAlek",
