			"description": "\ud83d\ude80 Top-rated, +200k earned\n\ud83d\ude80  Fast response\n\ud83d\ude80  Award the best designer on upwork in Ukraine for 2018 year.\n\nWelcome!\n\nI\u2019m a UI/UX Designer, Product Designer, Interaction Designer and Frontend Developer with more 8 years of experience. My goal is to make your ideas and business objectives into stunning useful designs. In each project, I first listen, learn, and understand and then execute my solution to the highest level.\n\nSee my portfolio on Behance and Dribbble.\n\n\u2b50\ufe0fbehance/jonyjayd \n\u2b50\ufe0fdribbble/yevled\n\nMy achievements\n\n\u2705 8 Years in Design and Development.\n\u2705 4400+ Hours worked on Upwork.\n\u2705 Top Rated on Upwork.\n\u2705 122 Success closed contracts on Upwork.\n\nExpertise: \n\n\ud83d\udd36 Design for web, mobile apps (iOS and Android)\n\ud83d\udd36 Interaction design (clickable design, animation)\n\ud83d\udd36 User experience and interface design\n\ud83d\udd36 Design thinking\n\ud83d\udd36 Material design\n\ud83d\udd36 Logo \u0026 Brand Identity Design\n\ud83d\udd36 Wireframes, prototyping, sitemap, user flow\n\ud83d\udd36 Web application design\n\ud83d\udd36 Frontend development (Html, CSS, JS, Jquery)\n\ud83d\udd36 Backend development\n\nBasic tools:\n\n\u2611\ufe0f Sketch app\n\u2611\ufe0f Photoshop\n\u2611\ufe0f Illustrator\n\u2611\ufe0f Principle\n\u2611\ufe0f Pixate\n\u2611\ufe0f InVision\n\u2611\ufe0f Marvel\n\u2611\ufe0f Proto.io\n\u2611\ufe0f Figma\n\u2611\ufe0f Adobe XD\n\u2611\ufe0f Trello, Asana, Basecamp, Jira\n\u2611\ufe0f Zeplin, Avocode\n\nHighlighted Skills: \nUI/UX Design, Mobile UI/UX Design, Web Design, Responsive Design, UX Design, User experience design, Frontend Development, Responsive Web Development, HTML, CSS, JavaScript, jQuery, WordPress, Website Development, iOS App Design, Android Design, iPad Design, iPhone Design.\n\nIf you\u0027d like to work together or have any questions feel free to get in touch.\n\nUpdated: 09 April, 2020",
