			"description": "\u201cChoose your corner, pick away at it carefully, intensely and to the best of your ability and that way you might change the world.\u201d -Charles Eames\n\nWhatever your corner is, we\u2019d love to help your vision come to life. With literally thousands of resources at hand, prices any budget can afford, and an unparalleled passion for project development, you\u2019re sure to get your voice heard with Online Impact. \n\nTo see live samples of sites, please check the bottom of my web design portfolio, here on my profile, where it contains mockups as well as live urls.\n\nI have helped clients with a variety of project backgrounds, and sizes. While I can help with many areas not listed below, here\u0027s what I do the most:\n\n*e-learning\n*e-commerce\n*membership sites\n*websites from scratch\n*websites from pre-made templates\n*WordPress\n*Shopify\n*Squarespace\n*Wix\n*Custom Mockups (PSD or Adobe XD)\n*logo design",
