			"ciphertext": "~01cadcf6a8160b3c06",
			"description": "12+ SaaS Products_90+ Projects\n\n- Sketch - Adobe XD - InVision Prototype - Adobe Photoshop - Figma - Adobe Illustrator\n- Invision Studio \n\nHighly motivated and qualified SaaS designer who is ready to work independently and to take care of any product from A to Z. I don\u2019t need micromanagement, just give me detailed documentation and healthy communication. Be sure, you will see significant progress in reasonable deadlines.\n\nPlease see my general workflow:\n\n1.Goal Identification\nThe main point of this phase is to find out the purpose of the website creation/redesign. This stage requires active cooperation with you, to be able to answer the core questions and to move forward to the next steps.\n\n2. Research and scope definition\nOnce I know the website\u0027s main goals, I can define the scope of the project (what pages and features the site require to fulfill the goal). The major part of this stage is the research of the industry and similar/competitor products.\n\n3. Sitemap and wireframe creation: \nFinishing with the results, I start with the sitemap creation and wireframing. In this stage the deliverables are wireframes to confirm the layout and functionality of each page. Each screen should be discussed and confirmed with you.\u2028It\u2019s highly favorable to do this stage at least simultaneously with the content creation.\n\n 4. Visuals and design\nConfirming all the wireframes, the I will move forward with the UI. Based on the research results I will create one screen to discuss with you and based on the confirmed version will apply the same style to the other sections design.\n\n5. Final Deliverables\nIn this stage I will organize the final deliverables based on your and developer needs.\n\n6. Design QA\nI will conduct detailed QA of the design after development stage is done, to make sure the live version is consistent with the approved design.\n\n\n\n\n",
