		"coverLetter": "Greetings, Hussain! \ud83e\udd1d\n\nThanks for your invitation!\n\nOur process of creating your Web Design will include such steps (almost like your list): \n1. Niche \u0026 Competitors Analysis.\n2. Ideating and Focusing on CTA/USP and Come up with new ideas. CJM. User Flows. Prototype.\n3. UI Responsive Web Design with Desktop layouts and Tablet\u0026Mob layouts / UI kit.\nIn the bag :) So, you\u0027ll get an Effective unique Web Design for your Software System and App based on Usability and User-Centered.\nFor the implementation, we\u0027ll need to talk separately.\n\nSome of our works:\nhttps://makeing.net/portfolio/inexpand/\nhttps://www.upwork.com/freelancers/~0111ff4eaa68ca1d6c?p=1062810039694999552 - https://part-auto.ru/\nhttps://www.behance.net/gallery/91091399/checky9com\nhttps://makeing.net/portfolio/denizon/\n\n\ud83d\udccc Our links:\n - Our Website - https://makeing.net/\n - TOP50 \u0026 Reviews - https://www.fl.ru/users/tapahtyjl/\n - UpWork - https://www.upwork.com/freelancers/~0111ff4eaa68ca1d6c\n\nWe are free now, so let\u0027s get the ball rolling on your project! \nWish you to have a nice day, keep healthy with that f*cking Coronavirus and waiting for your response, Hussain \ud83e\udd1d\n\nSincerely,\n\nEugene Batezat\n\nFounder \u0026 CEO \nMakeING Team - Odessa, Ukraine",
