			"description": "Our main focus is custom web applications development, websites, browser extensions. We offer a full range of services in this field:\n- UX / UI development: wireframes, mockups, branding, color scheme, style guide\n- Increasing CR: UX/UI analysis, A/B testing, analyzing customer behaviour with GA and other tools\n- Increasing page performance and page load speed: Google PageSpeed Insights, Google Chrome Audit, WebPageTest.org, Pingdom Web Page Speed Test, etc.\n- Responsive HTML-coding: HTML5/CSS3, SASS/LESS/Stylus, Bootstrap/Material Design, jQuery\n- Front-end development: Angular, React, jQuery (for small/legacy projects)\n- Back-end development: PHP (Laravel), Node.js (Express.js, Sequelize, etc.)\n- Databases and data stores: MySQL, PostgreSQL, MongoDB, Redis, Memcache, Elasticsearch,\n- Web hostings: AWS, Heroku, DigitalOcean, Hetzner\n- AWS: S3, VPC,  EC2, OpsWorks, EBS, RDS, ElastiCache, CloudWatch, Route53, CloudFront, AWS Lambda (including serverless.com framework), AWS Elasticsearch, AWS Batch\n- QA and test automation: Checklists, test cases and test plans, automated tests with selenium, puppeteer, etc.\n- Other technologies: WebSockets, Apache/Nginx, RabbitMQ, CloudFlare, Prerender.io, MailChimp, SparkPost, etc.\n\nSince 2005 we have been working in the area of web development. Since 2012 we are a reliable outsourcing partner and work with clients from Europe and North America. At the moment we have about 30 employees in 2 offices in Ukraine.\n\nOur employees have expertise in more than 30 fields of activities: cosmetology, online courses, oil and gas trade, touristic business, restaurant business, dentistry, landing pages, coupon and discount sites, browser extensions and countless data parsers and scrapers, SaaS, StartUp, e-Commerce, CRM/ERP, education, show jumping, hotel, MLM  and many others. In 2013 - 2014 we made two own StartUps.\n\nMore on our\u2019s company website: abz.agency.",
