			"ciphertext": "~016ab951616ed272fd",
			"description": "I\u0027m Bianca Bargan, and I\u0027m a UX/Ui App Designer,  I\u2019ve been creating complex and simple digital products for more than 3 years.\nMy interests are centered on projects that require creativity, endurance and the ability to work with others as a team. I am always looking for a problem to solve, a new mountain to climb.\nYou get \u21e3\u21e3\n\n\u2713 100% unique \u0026 high-quality design ( Please check my portfolio below \u0026 you will love it )\n\u2713 Professional and user-friendly design\n\u2713 Interactive Prototype\n\u2713 iOS + Android versions\n\u2713 Source files and all necessary assets and detailed guideline for development\n\nThe process\u21e3\u21e3\n\n\u2713 Understanding your business and goals\n\u2713 Proper research about your niche, competitors and your design expectations\n\u2713 Wireframe to generate ideas and UX solutions\n\u2713 Start UI/Visual design\n\n\n\n",
