		"coverLetter": "Hi Hussain! Than you for the invite. Being an experienced UX/UI designer, I\u0027d be glad to help you create designs for your website and its cross-platform mobile application. I have more than 8 years of experience and during this time I have created numerous apps and websites designs. You can find these examples of my work on my Behance and by the links below.\n\nPlease take a look at my portfolio and also don\u0027t forget to check the attachments:\nhttps://www.behance.net/grigoryisla5c9\n\nHere an example of my Figma project. Please, check this out:\nhttps://www.figma.com/file/M3z9igYPzZVcRJWnYjzNeg/Scoot911-App?node-id=0%3A5704\nhttps://www.figma.com/file/6IQOI5fx6cWLRXTOOwYVt2/Scooter?node-id=0%3A1\n\nI am ready for experiments and challenging projects.\nAvailable 30-40h/week.\nFluent English.\n\nI wish we could make a call to discuss the project and proceed. I can start work immediately after we will discuss the details of this project. Please tell me when it will be convenient for you to have a call? \n\nKind regards,\nGreg",
