			"ciphertext": "~013680bd9246cedee3",
			"description": "Need a Website or App design?\nYou have found exactly the person that you need! \n\nI have worked for 9 years in both Web and Mobile user interface (UI) and user experience (UX) fields.\nI keep an eye on the main design trends and prefer empathetic effective yet clean and minimalistic designs.\nI have worked on many projects for different industries: SaaS, IT, E-commerce, Fitness, Medicine, Social, Education.\n                                     \nDESIGNING PROCESS\n\nIt is very important to keep a well-structured workflow. I keep things simple and flexible. I find out the user needs and implement them into my designs to benefit your business best. \nI use the Iterative approach to receive timely feedback and make sure that we are on the same page with my client. My projects grow step by step and achieve the maximum results in the end. \nI can handle work under pressure with tight deadlines and always keep my client up to date about the situation of the project. \nI am available 30 hours a week, can work a full day if the complexity of the project requires such input.\n\nTOOLS THAT I USE\n\nFigma, Photoshop, Invision.\n\nWHY WORK WITH ME?\n\n1) Fluent English\n2) 9 years of UI/UX experience\n3) Knowledge of CSS/HTML\n4) Open to experiments\n5) Quality at the best value for money\n\nMy goal is to deliver a Top-quality product that will improve your business processes, increase audience engagement and customer loyalty. \n\nMessage me if you are interested!\nLooking forward to cooperating with you.\n\nYou can find me using these keywords:\nUX/UI, UX, UI, user interface, user experience, UX design, UI design, mobile design, UX designer, UI designer, web design, landing page design, web app design, product design, user interface design, user experience design, UX UI designer",
