		"coverLetter": "Hi Hussain! Thank you for the invite. As an experienced UI/UX designer I\u0027d be glad to help you perform all steps of the design and development process of the different UI interfaces of your Software System including Web and Mobile. I will be happy to conduct an investigation, understand your business and technical requirements and convert them to UX wireframes and final mockups and designs. You can find examples of my work here in the attached files and on my Behance.\n\nIn order to make sure that I\u0027m professional you can see my portfolio below (please don\u0027t forget to check the attachments):\nhttps://www.behance.net/Yuriy-Petrylyak\n\nI am also proficient with, UI/UX design for Web app, mobile app. Website and Landing page design and Wireframing, Prototyping or MVP creation.\n\nI am ready for experiments and challenging projects.\nAvailable 30-40h/week.\nFluent English.\n\nI wish we could make a call to discuss the project and proceed. I can start work immediately after we will discuss the details of this project. Please tell me when it will be convenient for you to have a call?\n\nKind regards,\nYuriy",
