			"ciphertext": "~0116b257007b6e07b1",
			"description": "Need a UX/UI Designer? Want your Site or App to look modern and be successful?\nIf Yes, then you have come to the right place!\n\nHire me if you need:\n\nWebsite and Landing page designer.\nApplication design.\nUser flow, Wireframes.\nMock-up, Prototype or MVP.\nMobile version and Responsive design. \nI am ready for experiments and challenging projects.\n\nFor the last 5 years, I have been working at the agency and reached the position of a Team Lead. \nI have experience in advertisement and marketing, I understand your customers\u2019 needs.\n\nI worked with different companies representing SaaS, E-Commerce, IT, Medical, Social, Industrial and Governmental areas. \n\nAvailable 30-40h/week.\nI can work with a team or solo. \nKnow HTML/CSS/Javascript. \n\nLooking forward to cooperating with you!",
