		"modifiedTs": "2020-03-30T15:08:50.142Z",
		"coverLetter": "Hi Hussain\n\nThanks for reaching out! \nThis is a very exciting project and we would be happy to employ our experience and expertise to create a user-friendly platform for you!\nWe are Habitat - a full-service design agency, with years of experience in designing mobile applications, websites, and dashboards. We have worked with the fintech domain and can help you with your product.\nFirst of all, I want to share a portfolio and other links that tell about our agency.\n\nPortfolio --\u003E http://bit.ly/2ZxwcPO\nDribbble --\u003E https://dribbble.com/hbtat\nWebsite --\u003E hbtat.agency\nFeedback from our clients --\u003E https://clutch.co/profile/habitat-design-agency\n\n\nLet me also introduce my team. Our team consists of product designers, UX/UI designers, graphic and web designers, brand designer, social media designer, and 3D \u0026 motion designer. The core principle that guides our work is a human-centered design and we always think about how to improve the usability for the end-user.\n\nWe have a clear understanding of technologies that result in a seamless collaboration with the technical team. Our senior designers possess a significant ability to conceptualize complex systems and create intuitive user flows. Thanks to the tight collaboration and organizational planning, our team is fast and efficient. Also, we practice the Agile framework, conducting daily meetings, planning our sprints, and communicating with our clients regularly. \n\nWe are flexible and at the same time have built a solid design process through the years. Ideally, we begin with profound research on competitors, market and users. We create user personas and afterward move on to wireframes. After the wireframes are finalized, we proceed to the UI part and design fully-clickable prototypes. Apart from that, we can create:\n- unique branding identity, \n- promo and educational videos\n- pitch decks\n- marketing materials, like emails, social media posts, and ads design.\n\nHere are some of the projects from the Fintech domain that we designed:\n- expenses management dashboard Staple -\nhttps://invis.io/AGTCSXV94X5\n\n- Platform that allows shoppers to collect their cashback in cryptocurrencies - Xank\nhttps://invis.io/54VVOHSW7EN\n\n- SaaS for payment terminals Smart Cashier -https://www.upwork.com/agencies/~0117669b3b150615bb/portfolio/project/1181197885464129536\n\n\n If you want we can have a call and discuss further details of the website, your requirements and our capabilities. After that we could estimate time/cost of the design work required.\n\nBest regards,\nVictor\n\nP.s. Habitat is a new name for the agency that was called Shortcute before. That is why we look like a new agency at Upwork, although in reality, we are 4 years old. \nWe went through renaming to better represent our philosophy and services --\u003E https://dribbble.com/shots/8069491-Say-hello-to-Habitat?utm_source=Clipboard_Shot\u0026utm_campaign=hbtat\u0026utm_content=Say%20hello%20to%20Habitat!\u0026utm_medium=Social_Share",
