			"ciphertext": "~01b05a09d55e3138ce",
			"description": "I am the founder and Art Director at Habitat Design Agency with 10+ years in UX/UI design.  While working with startups and well-established corporations in Fin-tech, e-commerce, fashion, health, and marketing domains, I obtained in-depth knowledge and expertise in product and service design.  I also offer consulting and design audit services to help my clients improve their UX strategy and conversion rates. \n\nYears of training ideation and conceptualization skills enable me to solve any visual design problem. I create intuitive and unique interfaces based on user research, user testing, and the latest design trends. Being meticulous and attentive to the detail, I deliver pixel-perfect designs.\n\nHabitat is a cross-functional team of UX/UI, motion and 3D, web and graphic designers. Together we can take a project of any discipline, size, and complexity successfully.\nTools: Sketch, Adobe Photoshop, Illustrator, InDesign, Principle, and Origami.\nJust send me a message, so that we can start solving your problem.",
