		"modifiedTs": "2020-03-29T13:03:46.085Z",
		"coverLetter": "Hi,\n\nI hope you are doing good with good health, my name is Mazhar Sharif, and I am a Sr.Prodct Designer (UX/UI) currently serving IBM Dubai as a contractor. I\u0027m currently nearing the end of my contract and available in the market for new opportunities, I am so excited to discuss with you about the project which posted here.\n\nI am confident that my qualifications, skills and past working experiences are relevant to the requirements of the position and I can make significant contributions to the continued success of your project.\n\nI bring over 10 plus years of experience to my role as a Design Consultant (UX/UI) in the digital and Agency arena. I focus my efforts on designing websites, mobile apps, web applications and print campaigns with a spotlight on usability. My broad range of design expertise spans many channels, including a strong concentration in corporate identity and branding. As a visual consultant, I have collaborated on many large projects, working with talented teams of artists, developers, usability experts, and marketing professionals. Along with strong work ethics, I approach every project with the same attention and workflow, drawing on my creative talents and business experience to get the job done right.\n\nSpecializations:\nUser Research, User Persona, Empathy Mapping, Customer Journey Mapping, Design thinking workshop (co-facilitation), Project Scoping, Information Architecture, Site mapping, User Flows, Wire-framing, Prototyping, UI designing, User Testing, User Interface Design, Mobile Application Design, Printed Marketing Materials, Advertisements, Logo/Identity Design, Corporate Identity Design.\n\nPortfolio:\nwww.behance.net/mazharshf\n\nMy LinkedIn Profile:\nwww.linkedin.com/in/mscreative/\n\n\nRegards\nMazhar",
