			"description": "I am a creative enthusiast and the technologist with 10 plus years handful experience in UX \u0026 UI Design with the proven know-how to combine creative and usability viewpoints resulting in world-class Web and mobile\napplications.\n\nI design a high impact, user-centered websites, and mobile apps with a strong emotional appeal, sophisticated production values, and intuitive navigation to maximize user engagement and cement powerful brand identities.\n\nkey Skills \n- User Research, Design thinking workshop (co-facilitation), Project Scoping\n- User Personas,  Empathy Mapping, Customer Journey Mapping, Storyboarding, Information Architecture, User Flows\n- Wire-framing, Prototyping, User Testing, UI Designing, AB Testing\n- Design and implementation of Design Systems, Atomic Design System\n\nDesign Tools \n Sketch, Figram, XD, Overflow, InVison, InVison DSM, Abstract,  Zeplin, Protopie, Principle, JIRA, Wrike, Clicktail, MIRO, Optimizely.\n ",
