		"modifiedTs": "2020-03-29T13:04:46.496Z",
		"coverLetter": "Good day,\n\nI know i probably dont meet your requirement for at least $ 1000 earned, but i am very much confident that i am qualified for the job, as i had the opportunity to work on a cross platform system similar to your project. \n\nI was recently tasked by a company i work with remotely to design a User Interface for Facility Management System, the company offers their clients a platform where they can hire artisans and handymen to carryout jobs for them, the project is in 4 sections, The landing page, admin dashboard, users (customers) mobile app and vendors (artisans) mobile app, and they are all cross platform and depending on one another to function as one entity.\n\nI primary assignment was to conduct user research and come up with an interaction design, detailing the user flow process of the entire system and how they will interact with each other and the users, conduct usability testing and research, the project has been shipped off and handed off to the engineers for development and will soon be launched on iOS and Playstore respectively.\n\nBelow is a link to the Mockup (Figma) for the project\n\nLanding Page\nhttps://www.figma.com/file/CGZaUQuPdMv1SstGPxVJUx/FMS-Redesign?node-id=0%3A1\n\nAdmin Dashboard\nhttps://www.figma.com/file/CGZaUQuPdMv1SstGPxVJUx/FMS-Redesign?node-id=21%3A0\n\nVendors Mobile App\nhttps://www.figma.com/file/CGZaUQuPdMv1SstGPxVJUx/FMS-Redesign?node-id=21%3A49\n\nCustomers/Users Mobile App\nhttps://www.figma.com/file/CGZaUQuPdMv1SstGPxVJUx/FMS-Redesign?node-id=21%3A49\n\nMy name is Usman, i am a UI/UX Designer, i currently work both as a full time UI/UX Designer and a freelance, i have over 4 years experience as a UI/UX Designer and over 6 years experience as front end developer.\n\nI am proficient with Adobe XD, Figma, Illustrator and Photoshop, i also vast experience working with user experience design tools like UXPin, Wireframe.cc and InVision, i have vast experience designing responsive, user centered, usable and accessible User Interfaces that are fully backed with professional user research and interaction design principles and guidelines, my experience as a front end developer has also broadened and sharpened my scope and skills as UI/UX Designer.\n\nI have worked and presently working with teams remotely in delivering scale-able web applications and mobile applications to clients across the globe.\n\nBelow is a link to the Mockup (Figma)\n\nLanding Page\nhttps://www.figma.com/file/CGZaUQuPdMv1SstGPxVJUx/FMS-Redesign?node-id=0%3A1\n\nAdmin Dashboard\nhttps://www.figma.com/file/CGZaUQuPdMv1SstGPxVJUx/FMS-Redesign?node-id=21%3A0\n\nVendors Mobile App\nhttps://www.figma.com/file/CGZaUQuPdMv1SstGPxVJUx/FMS-Redesign?node-id=21%3A49\n\nCustomers/Users Mobile App\nhttps://www.figma.com/file/CGZaUQuPdMv1SstGPxVJUx/FMS-Redesign?node-id=21%3A49\n\nbelow is my behance and dribble portfolio for your perusal\nhttps://www.behance.net/usmanndako1553\nhttps://dribbble.com/djdakman\n\nThank you.",
